import styles from './styles.css';

import React from 'react';

const CardsActivities = () => {
    return (
        <div className="cards-container">
        <div className="card">
            <div className="image-overlay">
            <img src="imagen1.jpg" alt="Actividad 1" />
            </div>
            <button className="card-button">Ver m치s</button>
        </div>
        <div className="card">
            <div className="image-overlay">
            <img src="imagen2.jpg" alt="Actividad 2" />
            </div>
            <button className="card-button">Ver m치s</button>
        </div>
        <div className="card">
            <div className="image-overlay">
            <img src="imagen3.jpg" alt="Actividad 3" />
            </div>
            <button className="card-button">Ver m치s</button>
        </div>
        </div>
    );
};

export default CardsActivities;
